import React from 'react';
import '../stylesheets/Taskbar.css';

function Taskbar() {
  return (
    <div className="taskbar">
      <a href="/">
        <img src="%PUBLIC_URL%/img/logo.png" alt="My Website" className="logo-image taskbar-item" />
      </a>
      <a href="/" className="taskbar-button active taskbar-item">Home</a>
      <a href="/page1" className="taskbar-button taskbar-item">Page 1</a>
      <a href="/page2" className="taskbar-button taskbar-item">Page 2</a>
      <a href="/page3" className="taskbar-button taskbar-item">Page 3</a>
      <a href="/page4" className="taskbar-button taskbar-item">Page 4</a>
      <a href="/page5" className="taskbar-button taskbar-item">Page 5</a>
    </div>
  );
}

export default Taskbar;
